import React, { Component } from 'react'
import Signup from './Signup'

class HomePage extends Component {
    constructor() {
        super()
        this.state = {
            likes: 0
        }
    }

    handleRe = () => {
        this.setState({ likes: 3 })
    }

    render() {
        return (
            <div>
                <div onClick={this.handleRe}>
                    signup
                </div>
            </div>
        )
    }
}

export default HomePage
